    __webpack_exports__["default"] = "<h2 class=\"row\"> \n Projects and Classes\n</h2>\n<hr>\n<h4> Projects </h4>\n<hr>\n<!-- MHD App -->\n<div class=\"project container\">\n\t<h5> Mental Health Day Tracker - Web Application </h5>\n\t<small>Fall 2019 - Advanced Software Engineering</small>\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t<div style=\"width: 3%\"></div>\n\t\t\t<div class=\"col\"><p> Created a full stack web application for Halleck Willard Inc. to track employee's mental health days off. Worked with two other students and used MongoDB, Express, Angular, and NodeJS. Used bootstrap to style the pages and tried to maintain their time tracking website's style. We faced many challenges including learning barriers, difficulties with the technology, and scope changes over the course of the project. </p></div>\n\t\t\t<div class=\"col-7\"><img src=\"../../assets/images/fieldSesh1.png\" class=\"project\" /></div>\n\t\t</div>\n\t</div>\n</div>\n<hr>\n<!-- Morio Kart -->\n<div class=\"project container\">\n\t<h5> Mario Kart Replica - C++ & OpenGL </h5>\n\t<small>Fall 2019 - Computer Graphics</small>\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t<div style=\"width: 3%\"></div>\n\t\t\t<div class=\"col\"><p> Worked in a team of thre to create a very basic recreation of Mario Kart. Used C++ and OpenGL. Our rendition included multiple shaders, prebuilt 3d models, animations, and a timing and lap counting system. The road used a .txt file to generate, allowing the user to build more levels at their desire. A skybox is used to give a feeling of being in outer space. </p><a href=\"https://github.com/dkoMines/MorioKart\"> Github Repo </a></div>\n\t\t\t<div class=\"col-7\"><img src=\"../../assets/images/final_2.png\" class=\"project\" /></div>\n\t\t</div>\n\t</div>\n</div>\n<hr>\n<!-- AlgoBowl -->\n<div class=\"project container\">\n\t<h5> AlgoBowl Competition </h5>\n\t<small>Spring 2019 - Algorithms</small>\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t<div style=\"width: 3%\"></div>\n\t\t\t<div class=\"col\"><p> Competed in an in-class competition to create the most efficient algorithm for the challenge. We finished 7th out of 19 groups in the class, using python to implement our algorithm. The challenge: Using only previously generated numbers and 1, sum up to the given inputs. For example, to add up to 5 and 7, it would take 5 numbers. 1,2,3,5, and 7. Each team submitted an input as well to challenge other groups. </p> <a href=\"https://algobowl.mines.edu/\">AlgoBowl Website</a> <br>\n\t\t\t\t<a href=\"https://github.com/dkoMines/Algobowl_Sp2019\" style=\"margin-bottom: 10px\"> Our Solution (Github)</a></div>\n\t\t\t<!-- <div class=\"col-7\"><img src=\"../../assets/images/.png\" class=\"project\" /></div> -->\n\t\t</div>\n\n\t</div>\n</div>\n<hr>\n<!-- Clue -->\n<div class=\"project container\">\n\t<h5> Clue Game </h5>\n\t<small>Fall 2018 - Software Engineering</small>\n\t<div class=\"container\">\n\t\t<div class=\"row\">\n\t\t<div style=\"width: 3%\"></div>\n\t\t\t<div class=\"col\"><p> Used Java to create a replication of the classic board game CLUE. Used Agile Development, Pair Programming, and Git to help develop this game with a partner. Also created a note sheet with the game to help players keep track of information revealed. Other pieces are controlled by a simple AI. We used extensive test driven development throughout the process. </p></div>\n\t\t\t<div class=\"col-7\"><img src=\"../../assets/images/clue.png\" class=\"project\" /></div>\n\t\t</div>\n\t</div>\n</div>\n<hr>\n<!-- ===================================== Classes ========================= -->\n<h4> Classes </h4>\n<hr>\n<!-- Field Session -->\n<div class=\"class container\">\n\t<h5> Advanced Software Engineering </h5>\n\t<small>CPW : Fall 2019</small>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Work with an industry client to apply software engineering skills to a challenging problem. I worked in a team of 3 to create a mental health day tracking web application for Halleck Willard Inc. We used NodeJs, Express, MongoDb, and Angular. We documented the entire process and presented our project to the class at the end of the semester. </p>\n\t</div>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Skills: Full Stack Development, Agile Development Process, Working in a team </p>\n\t</div>\n</div>\n<hr>\n<!-- Algorithms -->\n<div class=\"class container\">\n\t<h5> Algorithms </h5>\n\t<small>Dinesh Mehta : Spring 2019</small>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Learned a variety of methods to solve problems and about how to analyze those solutions. Went over data structures, priority queues, advanced sorting algorithms, complexity, dynamic programming, algorithms on weighted and unweighted graphs. Competed in the Algobowl competition in this class. </p>\n\t</div>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Skills: Critical Thinking, Problem Solving, Efficiency, Advanced Algorithmic Concepts</p>\n\t</div>\n</div>\n<hr>\n<!-- Computer Graphics -->\n<div class=\"class container\">\n\t<h5> Computer Graphics </h5>\n\t<small>Jeffrey Paone : Fall 2019</small>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Used C++ and OpenGL to explore basic 3d rendering and modeling techniques. In particular, we covered ray tracing, graphics pipeline, modeling techniques based on polynomial curves and patches, subdivision for curves and surfaces, scene graphs, BSP trees and their applications, and elements of global illumination. </p>\n\t</div>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Skills: C++, OpenGL, Basic computer graphic concepts, Rendering Pipeline Stages</p>\n\t</div>\n</div>\n<hr>\n\n<!-- Software Engineering -->\n<div class=\"class container\">\n\t<h5> Software Engineering </h5>\n\t<small>Mark Baldwin : Fall 2018</small>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Learned basic software engineering processes and object oriented design principles. Went over and used Agile Development, test driven development, UML design, and object oriented design patterns. Created the game of Clue, with a partner, using Java implementing skills used in the class. </p>\n\t</div>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Skills: Java, Agile, UML, Object Oriented Programming, Pair Programming, Unit Testing</p>\n\t</div>\n</div>\n<hr>\n<!-- Data Structures -->\n<div class=\"class container\">\n\t<h5> Data Structures </h5>\n\t<small>CPW : Spring 2018</small>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Used C++ to explore data structures such as linked lists, stacks, queues, binary trees, binary heap, hash tables. Introduction to algorithm analysis, with emphasis on sorting and search routines. Language skills: abstract data types, templates and inheritance. </p>\n\t</div>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Skills: C++, Data Structure basics, basic algorithm analysis, language skills</p>\n\t</div>\n</div>\n<hr>\n<!-- Additional Classes -->\n<div class=\"class container\">\n\t<h5> Current Classes </h5>\n\t<!-- <small>CPW : Spring 2018</small> -->\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Mobile Application Development, Artificial Intelligence </p>\n\t</div>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<!-- <p class=\"describe\"> Skills: C++, Data Structure basics, basic algorithm analysis, language skills</p> -->\n\t</div>\n</div>\n<hr>\n<!-- Additional Classes -->\n<div class=\"class container\">\n\t<h5> Additional Computer Science Classes </h5>\n\t<!-- <small>CPW : Spring 2018</small> -->\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<p class=\"describe\"> Introduction to Linux, Discrete Math, Linear Algebra, Database Management, Operating Systems. </p>\n\t</div>\n\t<div class=\"row\">\n\t\t<div style=\"width: 5%\"></div>\n\t\t<!-- <p class=\"describe\"> Skills: C++, Data Structure basics, basic algorithm analysis, language skills</p> -->\n\t</div>\n</div>\n<hr>\n";
